import React from "react";
import { data } from "./data";
class House extends React.Component{
constructor(){
    super()
    this.state={
    cloud:data
}
}
render(){
    return(
   this.state.cloud.map((value)=>
    <div className="wrapper">
        <div></div>
          <div>
            <p>{value.name}</p>
            <p>{value.place}</p>  
          </div>
        <div>

        </div>


    </div>

   )
    )
}
}
export {House}
